import { Component } from "react";
import {Link} from 'react-router-dom';
import axios from "axios";

class Note extends Component {
   
   componentDidMount () {
       const response = axios.get('./api/note')
   }
   
   
    render() {
        const mystyle = {
            width: "18rem",
            flex: "1 1 auto",
            minheight: "1px",
            padding: "1.25rem"
          };
        return (
            <div>
                <div className="container">
                    <div className="row">
                        <div className="col-md-12">
                            <div className="card">
                                <div className="card-header">
                                    <h3>Notes
                                        <Link to={'add-note'} className="btn btn-primary btn-sm float-end">Add Note</Link> 
                                    </h3>
                                </div>                            
                            </div>
                        </div>
                    </div>
                </div> <br />
                {/* notes */}
                        <div className="container">
                            <div className="row">
                                <div className="col-sm-4">
                                    <div className="card" style={{mystyle}}>
                                        <div className="card-body">
                                            <h5 className="card-title">Card title</h5>
                                            <h6 className="card-subtitle mb-2 text-muted">Card subtitle</h6>
                                            <p className="card-text">Quick sample text to create the card title and make up the body of the card's content.</p>
                                            <a href="#" className="card-link">Edit</a>
                                            <a href="#" className="card-link">Delete</a>
                                        </div>
                                    </div>
                                </div>
                            </div>
                        </div>
            </div>
        )
    }
}

export default Note;
